    [],nt"num_tags": 5,nt"name": "narrative-report-bombay-hook-national-wildlife-refuge-may-august-1958",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Bombay Hook NWR
    outlines Refuge accomplishments from May through August of 1958. The report begins
    by summarizing the weather conditions, habitat conditions, water conditions, and
    food and cover during this period. Wildlife- including migratory birds, upland game
    birds, big game animals, furbearers, predators, rodents, mammals, raptors, fish,
    and disease- is also covered. The Refuge development and maintenance section discusses
    physical developments, plantings, and vegetation control. A progress report on field
    investigations and applied research is also provided. The public relations section
    of the report describes recreational uses and Refuge visitors. N-R forms and photographs
    are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
